// ** create-user.component.js ** //
import { Link, useLocation } from "react-router-dom";

import React, { Component } from 'react';
import './model-profile.css';
import StarRating from 'react-star-rating';



const ModelProfile = () => {
    let user = useLocation().userProfile;
    
        this.setState({
          rating: newRating
        });
      
       //if user is undefined then redirect to home page 'models'
        if(user === undefined){
            window.location.href="/";
        } else {
               //else show model profile

            return (
                       
     <div class="page-content page-container" id="page-content">
        <div class="padding">
            <div class="row container d-flex justify-content-center">
                <div class="col-xl-6 col-md-12">
                    <div class="card user-card-full">
                        <div class="row m-l-0 m-r-0">
                            <div class="col-sm-4 bg-c-lite-green user-profile">
                                <div class="card-block  text-center text-white">
                                    <div class="m-b-25"> <img height='100px' width='100px' src={'https://i.mdel.net/i/db/'+user.image} alt={user.name} class="img-radius" /> </div>
                                    <h6 class="f-w-600">{user.name}</h6>
                                    <p>{user.type}</p> <i class=" mdi mdi-square-edit-outline feather icon-edit m-t-10 f-16"></i>
                                </div>
                            </div>
                            <div class="col-sm-8">
                                <div class="card-block">
                                    <h6 class="m-b-20 p-b-5 b-b-default f-w-600">Information</h6>
                                    <div class="row">
                                        <div class="col-sm-6">
                                            <p class="m-b-10 f-w-600">Email</p>
                                            <h6 class="text-muted f-w-400">rntng@gmail.com</h6>
                                        </div>
                                        <div class="col-sm-6">
                                            <p class="m-b-10 f-w-600">Phone</p>
                                            <h6 class="text-muted f-w-400">98979989898</h6>
                                        </div>
                                    </div>
                                    <h6 class="m-b-20 m-t-40 p-b-5 b-b-default f-w-600">Projects</h6>
                                    <div class="row">
                                    <form action="/api" method="POST">
                                    <StarRatings
          rating={this.state.rating}
          starRatedColor="blue"
          changeRating={ this.setState({
            rating: newRating
          })}
          numberOfStars={6}
          name='rating'
        />
                                        <button type="submit" className="btn btn-submit">Submit Rating</button>
                                    </form>
                                    </div>
                                    <ul class="social-link list-unstyled m-t-40 m-b-10">
                                        <li><a href="#!" data-toggle="tooltip" data-placement="bottom" title="" data-original-title="facebook" data-abc="true"><i class="mdi mdi-facebook feather icon-facebook facebook" aria-hidden="true"></i></a></li>
                                        <li><a href="#!" data-toggle="tooltip" data-placement="bottom" title="" data-original-title="twitter" data-abc="true"><i class="mdi mdi-twitter feather icon-twitter twitter" aria-hidden="true"></i></a></li>
                                        <li><a href="#!" data-toggle="tooltip" data-placement="bottom" title="" data-original-title="instagram" data-abc="true"><i class="mdi mdi-instagram feather icon-instagram instagram" aria-hidden="true"></i></a></li>
                                    </ul>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </div>
            )
        }
        
    
}


export default ModelProfile
